Attachments a binary files like images/videos or anything else stored in the WordPress uploads directory. Such binary data is handled a bit differently than textual - because it cannot be easily embedded into a JSON file. Below is a JSON Schema describing the attachment slice file format. Download JSON Schema definition for media files : slice-attachment.json { "$schema": "http://json-schema.org/draft-07/schema", "title": "ImpEx Content Slice", "description": "a ImpEx slice containing content", "type": "object", "properties": { "$schema": { "type": "string", "description": "The JSON schema for this slice" }, "version": { "title": "ImpEx Provider content version", "description": "Version will be used by ImpEx to know what data format to expect", "const": "1.0.0" }, "type": { "title": "ImpEx slice type", "description": "Value will be used by ImpEx to know the content type of the slice", "const": "php" }, "tag": { "title": "ImpEx slice tag", "description": "The ImpEx slice tag contains information about the responsible ImpEx provider for this slice", "const": "attachment" }, "meta": { "title": "Metadata for the slice", "description": "Metadata is a JSON object used to store additional information about the slice", "type": "object", "properties": { "entity": { "title": "Entity", "description": "The entity type of this slice", "type": "string", "default": "attachment", "enum": ["attachment"] }, "impex:post-references": { "title": "Array of urls referencing this attachment in posts", "description": "When the attachment was imported, all references in this array will be replaces by the url of the imported attachment", "type": "array", "items": { "type": "string" }, "minItems": 1, "$comment": "@TODO: unique ids are not yet supported by jsonschema", "uniqueItems": true } } }, "data": { "format": "uri-template", "type": "string", "title": "Data portion of this ImpEx slice", "description": "Attachment slice data is expected to be a URI to the attachment file.\nFor media it has to be the URI to the image.\nURI can be absolute or relative.", "examples": [ "./media/image.jpg", "https://www.example.com/attachment.jpg" ] } }, "additionalProperties": false, "required": ["version", "type", "tag", "meta", "data"]
} Let's say you have a reference to an image in your content : <img src="./greysen-johnson-unsplash.jpg" /> So you need to import the image into your WordPress instance. To do so, you need to create a slice-*json file (let's name it slice-0002.json) declaring the attachment : { "version": "1.0.0", "type": "resource", "tag": "attachment", "meta": { "entity": "attachment" }, "data": "./greysen-johnson-unsplash.jpg"
} As you can see, there is actually only the data property referencing the image. Rest of the slice file is just meta-data. provide the image in the same chunk directory as it's slice json file and prefixed with the slice json file name (slice-0002.json) : slice-0002-greysen-johnson-unsplash.jpg If you import the slice file using ImpEx, the image will appear in the WordPress uploads directory and in the WordPress media page. If you referenced the image in your content, it will also appear in your imported pages/posts. Remember: Content slices referencing media files should ALWAYS be imported before the attachment slices. This can be achieved by naming content slicing with a lower number than the media slices or - much simpler - keeping the content slices in a lower numbered chunk-* directory than the attachments. See simple-import example for a full featured manually written import at the ImpEx WordPress plugin GitHub repository . Adjusting attachment urls If you import posts referencing an image using relative paths, you will need to adjust the image url in your imported posts to the newly imported attachment. Suppose you have various posts referencing an image in different ways : <!-- sub/page-one.html -->
...
<img src="../images/greysen-johnson-unsplash.jpg" /> <!-- page-two.html -->
...
<img src="/images/greysen-johnson-unsplash.jpg" /> <!-- page-tree.html -->
...
<img src="./images/greysen-johnson-unsplash.jpg" /> After importing generated pages will reference exactly the same IMG src attribute, but the url of the imported image attachment will be different. In this case you can configure replacing the original with the url of the imported image using slice meta property impex:post-references. This property tells ImpEx that the given references should be replaced with the url of the imported attachment file. { "version": "1.0.0", "type": "resource", "tag": "attachment", "meta": { "entity": "attachment", "impex:post-references": [ "../images/greysen-johnson-unsplash.jpg", "./images/greysen-johnson-unsplash.jpg" "/images/greysen-johnson-unsplash.jpg", ] }, "data": "./greysen-johnson-unsplash.jpg"
}

