Data transformation into Gutenberg block annotated HTML is done by the ImpexTransformer singleton. ImpexTransformer can be configured by calling it's setup(...) function supporting various hooks for customizing the transformation. ImpexTransformer.transform(data) transforms the content provided in the data argument into Gutenberg block annotated HTML . ImpexTransformer.setup({/* options */}) Options verbose (boolean, default : false) enables verbose output for debugging purposes onLoad(data : any) : string (function, default : undefined) callback executed by transform(...) function. data argument is the initial data to transform. This callback is intended to be used for converting the initial data into HTML. Example: If your initial data is markdown content this callback should transform it to HTML: ...
ImpexTransformer.setup({ onLoad(data) { return markdown.toHTML(data); }
});
... If onLoad is not defined the transform function will assume the data argument is valid HTML. onDomReady(Document : document) : void (function, default : undefined) callback executed when HTML is loaded and the DOM is ready. At this stage, you can use the HTML DOM manipulation API (querySelector for example) to rearrange the HTML DOM the way you need. The Transformer uses JSDOM to provide DOM capabilities to NodeJS. So you can use everything you know about DOM manipulation in NodeJS. See tests for example usage. onRegisterCoreBlocks() : boolean (function, default : undefined) callback to register Gutenberg blocks. This callback is the power horse transforming HTML to Gutenberg block annotated HTML . Most transformation work is delegated to the Gutenberg Block Transforms API . This API processes the given DOM and applies the Gutenberg Block transformations of all registered blocks. The result is valid Gutenberg block annotated HTML as we want it. Using the onRegisterCoreBlocks callback you can register your own Gutenberg blocks (including their transform rules ) or attach additional transform rules to existing core Gutenberg blocks utilizing Gutenberg filter 'blocks.registerBlockType' . If your onRegisterCoreBlocks callback returns true, the core Gutenberg blocks transform rules will be reset to its defaults. If onRegisterCoreBlocks is not given, transform(...) will assume that the core Gutenberg blocks should be used as-is. See tests for example usage. onSerialize(blocks : array) : array (function, default : undefined) callback executed after the Gutenberg block transform rules have been applied. The resulting array of Gutenberg blocks is passed to the callback. The callback can modify the blocks array and is expected to return them. Example transforming all Gutenberg Image block attributes into caption block attribute. This will result in a <figcaption> element inside the block output: ImpexTransformer.setup({ onSerialize(blocks) { // takeover img[@title] as figcaption in every block for (const block of traverseBlocks(blocks)) { if (block.name === "core/image") { block.attributes.caption = block.attributes.title; delete block.attributes.title; } } return blocks; },
}); traverseBlocks is a helper function exposed by this package to traverse the Gutenberg block hierarchy like a flat array. See tests for example usage. ImpexTransformer.transform(data : any) : string The transform function transforms the given data into Gutenberg block annotated HTML . The data argument can be anything. All hooks configured using ImpexTransformer.setup(...) will take effect by executing this function. The returned string is valid Gutenberg block annotated HTML .

