To import the generated Gutenberg block annotated HTML into WordPress we need to generate ImpEx WordPress plugin conform JSON files wrapping the content with WordPress meta-data. Class ImpexSliceFactory provides a simple way to generate WordPress ImpEx Slice JSON structures . At first we need to create an instance of ImpexSliceFactory: const sliceFactory = new ImpexSliceFactory({ /* options */
}); There is just one (optional) option next_post_id : integer (default : 1) which might be used to provide a individual start post_id. next_post_id is only taken into account when creating content slices for WordPress content like posts/pages or media. The ImpEx WordPress plugin supports some more slice types (for exporting whole database tables and more) but in these cases next_post_id is not in use. Using the ImpexSliceFactory instance we've created we can now generate WordPress ImpEx Slice JSON structures for WordPress content or media by calling function createSlice(sliceType : string, callback(factory, sliceJson : any) : any). The sliceType argument is the type of the slice to be created. The callback function is called with the ImpexSliceFactory instance and the generated slice JSON structure as parameters . Encapsulate WordPress content into ImpEx JSON Creating the JSON for a WordPress post is dead simple : const slice = sliceFactory.createSlice("content-exporter", (factory, slice) => { slice.data.posts[0].title = "Hello"; slice.data.posts[0]["wp:post_content"] = "<!-- wp:paragraph --><p>my friend</p><!-- /wp:paragraph -->"; return slice;
}); Creating a WordPress page with some additional WordPress meta-data works the same way: const slice = sliceFactory.createSlice("content-exporter", (factory, slice) => { slice.data.posts[0].title = "Hello"; slice.data.posts[0]["wp:post_type"] = "page"; slice.data.posts[0]["wp:post_excerpt"] = "A page about my friend"; slice.data.posts[0]["wp:post_content"] = "<!-- wp:paragraph --><p>Hello my my friend</p><!-- /wp:paragraph -->"; return slice;
}); Encapsulate WordPress attachments like images into ImpEx JSON Creating the JSON for a WordPress attachment is even dead simple : // declares a attachment for image './foo.jpg'
const slice = sliceFactory.createSlice("attachment", (factory, slice) => { slice.data = "./foo.jpg"; return slice;
}); In most cases, our imported content (aka posts/pages) will reference the media in various ways like /image/foo.jpg or ../../images/foo.jpg and so on. ImpEx WordPress plugin will take care about replacing image references in Gutenberg block annotated HTML if we provide a replacement hint impex:post-references (see Attachments (like Pictures and Videos) for details). const slice = sliceFactory.createSlice("attachment", (factory, slice) => { slice.data = "./foo.jpg"; // will result in replacing all matching references in posts of the WordPress instance with the link to the imported image slice.meta["impex:post-references"] = [ "/image/foo.jpg", "../../images/foo.jpg", ]; return slice;
});

