Thanks to ImpEx architecture you normally don't need to define a custom import configuration. ImpEx sports a generic all import provider and profile importing anything exported using the ImpEx building blocks. As long as you use the Exporter provided by ImpEx in your custom Export profile, you don't need to define an matching custom import profile. In rare cases you need to execute PHP code after the import to get everything working. In our export profile example above we implemented support for Ninja Forms Contact Form . Unfortunately the forms will be in maintenance mode after importing them. To fix this we need to execute some PHP code (WPN_Helper::set_forms_maintenance_mode(0) from the Ninja Forms Contact Form Plugin ) after the import. ImpEx provides Events for exactly that purpose : \add_action('cm4all_wp_impex_register_profiles', function () { // ensure admin plugin functions are available require_once(ABSPATH . 'wp-admin/includes/plugin.php'); // get the 'all' profile $profile = Impex::getInstance()->Import->getProfile('all'); // attach a listener callback for the `EVENT_IMPORT_END` event $profile->events(ImpexImport::EVENT_IMPORT_END)->addListener( 'reset ninja forms mainentance mode', fn () => method_exists('WPN_Helper', 'set_forms_maintenance_mode') && WPN_Helper::set_forms_maintenance_mode(0) );
}); Tada - that's it ! There ist just one caveat ... what if the ImpEx 'all' profile gets disabled by someone else ? To work around this we can also introduce a custom import profile utilizing the 'all' import provider: \add_action('cm4all_wp_impex_register_profiles', function () { // ensure admin plugin functions are available require_once(ABSPATH . 'wp-admin/includes/plugin.php'); // create a new import profile $profile = Impex::getInstance()->Import->addProfile('impex-import-profile-example'); $profile->setDescription('Import everything example with event listener'); // reuse the 'all' import provider registered by the 'all' import profile $profile->addTask('main', Impex::getInstance()->Import->getProvider('all')->name); // attach a listener callback for the `EVENT_IMPORT_END` event $profile->events(ImpexImport::EVENT_IMPORT_END)->addListener( 'reset ninja forms mainentance mode', fn () => method_exists('WPN_Helper', 'set_forms_maintenance_mode') && WPN_Helper::set_forms_maintenance_mode(0) );
});
